import React from 'react';
import NavBar from './NavBar';
import SearchBar from './SearchBar'
import RecipeGrid from './RecipeGrid';
import { Link, useNavigate } from 'react-router-dom';
import './../App.css'

function SearchPage() {
    return (
        <div style={{backgrondColor:"#FFFCF3"}}>
        <NavBar searchbar={false}/>
        <div style ={{display:"block", position:"absolute", left:0, right:0, bottom:"50%"}}>
        <h1 id="Logo" style={{display:"flex", alignContent:"center", justifyContent:"center"}}>
            Foodstagram
        </h1>
        <Link>
        <SearchBar onFocus={() => useNavigate()('/result')}/>
        </Link>
        </div>
        </div>
    );
}

export default SearchPage;
